import React from 'react'
import './banner.scss'
const Banner = () => {
  return (
    <div className='banner'>
    <div className='banner-item1'> <div className='banner-item1-img'></div></div>
    <div  className='banner-item2'> <div className='banner-item2-img'></div></div>
    <div className='banner-item3'><div className='banner-item3-img'></div></div>    
    </div>
  )
}

export default Banner
